// src/components/CertificateView.jsx
import React from 'react';

export default function CertificateView({ onBack }) {
  return (
    <div className="max-w-2xl mx-auto mt-10 p-6 bg-white rounded-lg shadow">
      <h2 className="text-2xl font-bold mb-6">Congratulations!</h2>
      <p className="text-lg mb-4">
        Your certificate has been generated. You can download it below.
      </p>
      <button
        onClick={() => window.print()}
        className="bg-green-500 text-white py-2 px-4 rounded-md hover:bg-green-600 mr-4"
      >
        Download Certificate
      </button>
      <button
        onClick={onBack}
        className="bg-gray-500 text-white py-2 px-4 rounded-md hover:bg-gray-600"
      >
        Back to Home
      </button>
    </div>
  );
}
